import React, { Component } from "react";
import Tabs from "react-bootstrap/Tabs";

class Navbar extends Component {
  constructor(props) {
    super(props);

    this.state = { hidden: false };

    this.showElement = this.showElement.bind(this);
  }

  showElement(e) {
    e.persist();
