      this.setState({ hidden: true });
    } else {
      document.getElementsByClassName("education")[0].style.display = "block";

      this.setState({ hidden: false });
    }*/
  }

  render() {
    return (
      <Nav justify variant="tabs" defaultActiveKey="background">
        <Tab eventKey="background" title="BACKGROUND"></Tab>
        <Tab eventKey="education" title="EDUCATION"></Tab>
        <Tab eventKey="experience">EXPERIENCE</Tab>
        <Tab eventKey="skills">SKILLS</Tab>
        <Tab eventKey="apps">SOFTWARE></Tab>
      </Nav>
    );
  }
}

export default Navbar;
